import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from '/Users/vivekharsh/vivekharsh/src/HomePage.js';
import AboutPage from '/Users/vivekharsh/vivekharsh/src/AboutPage.js';
import ProjectsPage from '/Users/vivekharsh/vivekharsh/src/ProjectsPage.js';
import ContactPage from '/Users/vivekharsh/vivekharsh/src/ContactPage.js';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li><a href="/">Home</a></li>
            <li><a href="/about">About</a></li>
            <li><a href="/projects">Projects</a></li>
            <li><a href="/contact">Contact</a></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element={<AboutPage />} />
          <Route path="/projects" element={<ProjectsPage />} />
          <Route path="/contact" element={<ContactPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
